// client/src/pages/LoginPage.js
import React from 'react';

const LoginPage = () => {
  return (
    <div className="min-h-screen flex items-center justify-center bg-gray-100">
      <h1 className="text-2xl font-bold">Login Page</h1>
    </div>
  );
};

export default LoginPage;
